import React from 'react';
import './ProjectSection.css';
import Project from '../Project/Project';

function ProjectSection() {
    return (
        <div className="projectsection">
            <h2>Projects</h2>

            < Project
            title="Minimal Bitcoin Widget"
            description="A beautiful Android home screen widget that displays the current price of Bitcoin."
            link="https://github.com/juliancoronado/MinimalBitcoinWidget"/>

            <a href="https://play.google.com/store/apps/details?id=com.jcoronado.minimalbitcoinwidget&pcampaignid=pcampaignidMKT-Other-global-all-co-prtnr-py-PartBadge-Mar2515-1">
                <img id="store_badge" alt="Get it on Google Play" src="https://play.google.com/intl/en_us/badges/static/images/badges/en_badge_web_generic.png"/>
            </a> 

            <h4>More projects coming soon!</h4>

        </div>
    );
}

export default ProjectSection;
